    #region void
    protected void OpenDialog(EnTipoEvento Evento, EnTipoObjeto Objeto, Object DTO)
    {
        _Evento = Evento;
        _Objeto = Objeto;

        switch (Evento)
        {
            case EnTipoEvento.Alta:
                if (Objeto == EnTipoObjeto.Estado)
